package com.froad.fft.thirdparty.dto.response.points;

public class CashPointsInfo {

	private String cashPointsNo;
	
	private String objectNo;
	
	private String transferId;
	
	private String points;
	
	private String stateCode;
	
	private String remark;

	public String getCashPointsNo() {
		return cashPointsNo;
	}

	public void setCashPointsNo(String cashPointsNo) {
		this.cashPointsNo = cashPointsNo;
	}

	public String getObjectNo() {
		return objectNo;
	}

	public void setObjectNo(String objectNo) {
		this.objectNo = objectNo;
	}

	public String getTransferId() {
		return transferId;
	}

	public void setTransferId(String transferId) {
		this.transferId = transferId;
	}

	public String getPoints() {
		return points;
	}

	public void setPoints(String points) {
		this.points = points;
	}

	public String getStateCode() {
		return stateCode;
	}

	public void setStateCode(String stateCode) {
		this.stateCode = stateCode;
	}

	public String getRemark() {
		return remark;
	}

	public void setRemark(String remark) {
		this.remark = remark;
	}
	
	
	
}
